SELECT COUNT(*) FROM census WHERE age <= 48.0 AND workclass = 'Federal-gov' AND education = '10th' AND education_num <= 11.0 AND marital_status = 'Divorced' AND occupation = 'Prof-specialty' AND relationship = 'Other-relative' AND race = 'White' AND sex = 'Female' AND capital_gain <= 1767.0 AND capital_loss <= 1221.0 AND hours_per_week <= 65.0 AND native_country = 'Outlying-US(Guam-USVI-etc)';
